import { useState, useEffect } from 'react';
import React from 'react';

export default function RegisterNewUser() 
{
    const [userData, setUserData] = useState();
    useEffect(async ()=>
        {
          const data = await Request('POST', '/api/register', true, JSON.stringify({username: 'testUser', password: 'testPass'}));
          setUserData(data);
        }
    ,[])
    return (
        <div>
            <h1>Register</h1>
        </div>
    );
}
